"use strict";export function*range(n,t,o=1){const e=Math.sign(o);for(let r=n;e*r<e*t;r+=o)yield r}export function*rangeInt(n){yield*range(0,n)}export function*rangeIntAll(n,t){const o=t-n>=0?1:-1,e=n,r=t+o;yield*range(e,r,o)}export function*range2Int(n,t){for(const o of rangeInt(n))for(const n of rangeInt(t))yield[o,n]}export function*range2IntAll(n,t,o,e){for(const r of rangeIntAll(n,t))for(const n of rangeIntAll(o,e))yield[r,n]}